import * as React from 'react';
import {ImageCardList} from '../../components/ChooseImage';
import {Summary} from '../../components/Summary';


export interface IPage{
    dpage: string;
}

export interface OBuild{
    istate : IBuild;
}

export interface IBuild{
    id: string;
    cost: string;
    name: string;
    version: string;
    instance: string;
    memory: string;
    type: string;
    networks:string;
    securityGroup:string;
}


export interface  Bigprops {
    dpage:string;
    istate:IBuild;
    upstate :() => void;
}

// export function PageDisplay(props : IPage,stateprops:OBuild)  {
export function PageDisplay(bgprops:Bigprops)  {    
    // const nav = props;
    // bgprops.dpage = "3"; Pass by reference

    bgprops.istate.id = "5";
    {bgprops.upstate();};

    if(bgprops.dpage=="1"){
    return(
        <ImageCardList/>
    );
    }else if(bgprops.dpage=="2"){
    return(
        <h1>HI</h1>
    );
    }else if(bgprops.dpage=="3"){
    return(
        <h1>HI</h1>
    );
    }else if(bgprops.dpage=="4"){
    return(
        <h1>HI</h1>
    );
    }else if(bgprops.dpage=="5"){
    return(
        //  <Summary dpage={bgprops.dpage} istate={bgprops.istate}/>
        <p></p>
    );

    }

    return null;

};

